import { useState, useEffect } from "react"
import CardsMovies from "./CardsMovies"
import "./App.css"
import { Paper } from "@mui/material"


const Popular = () => {

    const [movies, setMovies] = useState([])
    useEffect(() => {
        fetch("https://api.themoviedb.org/3/movie/popular/?api_key=41514cf9c5004dbe47144dbf1928e39c")
            .then(res => res.json())
            .then(data => setMovies(data.results))

    }, [])

    return (

        <Paper className="paper" sx={{ display: "flex", justifyContent: "space-between" }} >
            <CardsMovies sx={{ maxHeight: 100 }}
                title="Popular Movis"
                movies={movies} />
        </Paper>



    )
}

export default Popular


